TOR VERGATA NUOVA - In stabile di recente costruzione (2017), a due passi dal centro commerciale di Tor Vergata, proponiamo in vendita appartamento bilocale posto al piano secondo con ascensore e così suddiviso: 
Ingresso, salone con cucina a vista, disimpegno, camera da letto matrimoniale, bagno ed ampio balcone.

Completano la proprietà un box auto ed una cantina.

L'immobile, costruzione 2017, è dotato inoltre dei seguenti accessori:
- Infissi in doppio vetro in pvc;
- Impianto di climatizzazione;
- Portone blindato;
- Videocitofono;
- Ascensore;
- Ingresso carrabile con cancello automatico;
- Classe energetica A+

Ogni agenzia ha un proprio titolare ed è autonoma - Le presenti informazioni non costituiscono elemento contrattuale.

Via di Tragliatella a 5 minuti da Via Braccianese. 
Retecasa propone villa unifamiliare bilivelli fuori terra con giardino di pertinenza esclusiva di circa 900 metri con alberi da frutto; L'immobile oggetto della vendita presenta l'entrata principale al piano primo dove troviamo un luminoso terrazzo che percorre tre lati dell'abitazione, nella zona giorno un ampio salone con camino e cucina abitabile; tre camere matrimoniali e due bagni di cui uno con vasca;
Completa la proprietà il piano terra (h. 2,30) al quale si può accedere sia da scala interna che da entrata indipendente con al suo interno soggiorno con cucina a vista tre camere, doppi servizi ed una piccola cantina. Termoautonomo, stato originale.

Villetta a schiera in zona Due Leoni Via Carlentini, di 140 mq, disposta su tre livelli:
Piano terra con entrata indipendente e composto da salone con angolo cottura, bagno, balcone e giardino di 20 mq;
Primo piano con due camere, bagno con doccia e balcone (leggermente mansardato ma vivibile);
Piano seminterrato accatastato C2 composto da cantina di 70 mq.
Con posto auto scoperto. Con impianto termoautonomo e condizionatori. 
A 500 metri da Via Casilina.

Vicino a tutti i principali servizi proponiamo un appartamento di ampia metratura posto al primo piano di una palazzina in cortina di tre;
Al suo interno dispone di salone con camino, cucina abitabile, due camere matrimoniali, doppi servizi e due terrazzi perimetrali;
L'immobile oggetto della vendita dispone di riscaldamento termoautotnomo, infissi alluminio doppio vetro e si presenta in buono stato di mautenzione.
Completa la proprietà il box auto di mq 23 posto al livello strada.
